import React from "react";
import { Card } from 'react-bootstrap'

const Home = () => {
  return (
    <>
      <div id="home" className="content">
        <Card className="card" bg="success" text="white" style={{ width: "18rem" }}>
          <Card.Body>
            <Card.Title>Última Apreensão de Arma</Card.Title>
            
            <Card.Text as="h3" className="mb-2">
              Caridade
            </Card.Text>

            <Card.Subtitle className="mb-2">
              01/06/2021 - 15h23min
            </Card.Subtitle>

          </Card.Body>
        </Card>
      </div>
    </>
  );
};

export default Home;
